import React from "react";
import {Card} from "antd";
import "./ItemCard.scss"
import {spliteUrl} from "../../../utils/helpers/functions";

const ItemCard = ({item, resource}) => {
    const {name, url} = item

    console.log('RPMRR', resource, url)
    let id = spliteUrl(url)

    const Img = () => {


        return (`https://starwars-visualguide.com/assets/img/${resource}/${id}.jpg`)
    }

    return  <div className="rootCard">
        <Card
            hoverable
            className="card"
            title={name}
        >
            <img src='https://starwars-visualguide.com/assets/img/${resource}/${id}.jpg'/>
        </Card>
    </div>
};
export default ItemCard;
